	public static void main(String[] args){
		int height = 7;
		int width = 5;
		int matrix[] = new int[height*width];
		HashMap<Integer,Integer> num = new HashMap<Integer,Integer>();
		num.put(0,0);
		num.put(1,10);
		num.put(2,30);
		
		
		
		for(int i = 0 ; i < height ; i++){
			for(int j = 0 ; j < width ; j++){
				if(matrix[i * width + j] == 0 && pixel[i * width + j] != 0){
					int var = num.get(pixel[i * width + j]);
					matrix[i * width + j] = var;
					recurs(i,j,matrix,width,height);
					var++;
					num.remove(pixel[i * width + j]);
					num.put(pixel[i * width + j],var);
				}
			}
		}
		ArrayList<ArrayList<Integer>> adjacentsList = new ArrayList<ArrayList<Integer>>() ;

		for(int i = 0 ; i < height - 1; i++){
			for(int j = 0 ; j < width - 1; j++){
				//right
				if(matrix[i * width + j] != matrix[i * width + j + 1] && !hasLabel(Math.max(matrix[i * width + j + 1], matrix[i * width + j]), Math.min(matrix[i * width + j + 1], matrix[i * width + j]),adjacentsList)){
				ArrayList<Integer> temp = new ArrayList<Integer>();
				temp.add(Math.max(matrix[i * width + j + 1], matrix[i * width + j]));temp.add(Math.min(matrix[i * width + j + 1], matrix[i * width + j ]));
				adjacentsList.add(temp);
				}
				//down
				if(matrix[i * width + j] != matrix[(i+1) * width + j] && !hasLabel(Math.max(matrix[i * width + j], matrix[(i+1) * width + j]), Math.min(matrix[i * width + j], matrix[(i+1) * width + j]),adjacentsList)){
				ArrayList<Integer> temp = new ArrayList<Integer>();
				temp.add(Math.max(matrix[i * width + j], matrix[(i+1) * width + j]));temp.add(Math.min(matrix[i * width + j], matrix[(i+1) * width + j]));
				adjacentsList.add(temp);
				}
			}
		}

		for(int i = 0 ; i < height ; i++){
			for(int j = 0 ; j < width ; j++){
				System.out.print(matrix[i * width + j] + ",");
			}
			System.out.println();
		}
			System.out.println();
		for(ArrayList<Integer> i : adjacentsList) {
			System.out.println(i.toString());
		}
		
	
	}

	public static boolean hasLabel(int dom1, int dom2, ArrayList<ArrayList<Integer>> adjacentsList) {
		for(ArrayList<Integer> i : adjacentsList) {
			if (i.get(0) == dom1 && i.get(1) == dom2) {
				return true;
			}
		}
		return false;
	}

	public static void recurs(int i, int j, int matrix[], int width, int height){
		
		//check right
		if(j != width - 1 && pixel[i * width + j + 1] == pixel[i * width + j] && matrix[i * width + j + 1] == 0){
			matrix[i * width + j + 1] = matrix[i * width + j];
			recurs(i,j+1,matrix,width,height);
		}

		//check left
		if(j != 0 && pixel[i * width + j - 1] == pixel[i * width + j] && matrix[i * width + j - 1] == 0){
			matrix[i * width + j - 1] = matrix[i * width + j];
			recurs(i,j-1,matrix,width,height);
		}

		//check down
		if(i != height - 1 && pixel[(i+1) * width + j] == pixel[i * width + j] && matrix[(i+1) * width + j] == 0){
			matrix[(i + 1) * width + j] = matrix[i * width + j];
			recurs(i+1,j,matrix,width,height);
		}

		//check up
		if(i != 0 && pixel[(i-1) * width + j ] == pixel[i * width + j] && matrix[(i-1) * width + j] == 0){
			matrix[(i - 1) * width + j] = matrix[i * width + j];
			recurs(i-1,j,matrix,width,height);
		}

	}
